import { Climber } from "./Climber"

export function ClimberList({ climbers, deleteClimber }) {
  return (
    <ul className="App" style={{ color: 'red' }}>
      {climbers.length === 0 && "No Climbers"}
      {climbers.map(climber => {
        return (
          <Climber
            {...climber}
            deleteClimber={deleteClimber}
          />
        )
      })}
    </ul>
  )
}
